CreatedDate_Year_Cre_6.query:
q = load "${App.Datasets.Opportunities_Amills_EasyMigrate_HyNLN.FullyQualifiedName}";
q = filter q by date('CreatedDate_Year', 'CreatedDate_Month', 'CreatedDate_Day') in [dateRange([2020,1,1], [2020,11,30])];

q = group q by ('CreatedDate_Year', 'CreatedDate_Week');

result = foreach q generate q.'CreatedDate_Year' as 'CreatedDate_Year', q.'CreatedDate_Week' as 'CreatedDate_Week', count()*50 as 'A';

result = fill result by (dateCols=('CreatedDate_Year','CreatedDate_Week',"Y-W"));

result = timeseries result generate A as fRevenue with (dateCols=('CreatedDate_Year','CreatedDate_Week',"Y-W"), length=10, predictionInterval=95);

result = foreach result generate 'CreatedDate_Year' + "~~~" + 'CreatedDate_Week' as 'CreatedDate_Year~~~CreatedDate_Week', coalesce(A, fRevenue)/100 as 'A', fRevenue_high_95/100 - 5 as fRevenue_high_95, fRevenue_low_95/100 + 4 as fRevenue_low_95;

result = order result by ('CreatedDate_Year~~~CreatedDate_Week' asc);

result = limit result 2000;

